import logo from './logo.svg';
import Header from './Header';
import './App.css';
import Cv from './routes/Cv';
import Home from "./routes/Home";
import Portofolio from "./routes/Portofolio";
import Gallery from "./routes/Gallery";
import Contact from "./routes/Contact";
import React, {useEffect, useState} from 'react';
import {Routes, Route} from "react-router-dom";


function App(){
  const [night, setNight] = useState(1);
  const [shift, setShift] = useState(0);

  return (
    <div className="App" >
      <Header night={night} shift={shift} setNight={setNight} setShift={setShift}/>
      <Routes>
        <Route id="Home" path="/" element={<Home />} />
        <Route path="CV" element={<Cv />} />
        <Route path="Portofolio" element={<Portofolio />} />
        <Route path="Gallery" element={<Gallery setNight={setNight} setShift={setShift}/>} />
        <Route path="Contact" element={<Contact/>} />
      </Routes>
    </div>
  );
};

export default App;
